  auto reduce_polymer = [](std::string& p_polymer)
  {
    for (auto i = 0; i < p_polymer.size() - 1; ++i)
    {
      auto currentChar = p_polymer[i];
      auto nextChar = p_polymer[i + 1];
      if (std::tolower(currentChar) == std::tolower(nextChar) && currentChar != nextChar)
      {
        p_polymer.erase(i, 2);
        i -= 1;
      }
    }
  };
  auto fully_reduce_polymer = [reduce_polymer](std::string& p_polymer)
  {
    int oldLength = -1;
    while (p_polymer.size() != oldLength)
    {
      oldLength = p_polymer.size();
      reduce_polymer(p_polymer);
    }
  };

  auto reducedPolymer = polymer;
  fully_reduce_polymer(reducedPolymer);
  std::cout << reducedPolymer.size() << '\n';

